angular.module('app.controllers')
    .controller('demoController', ['$scope', '$http', function($scope)
    {

        $("#plays_btn").click(function() {

            if (MIDI.Player.playing == true) {
                MIDI.Player.pause();
                $("#play_btn").show();
                $("#pause_btn").hide();
            } else {
                MIDI.Player.start();
                $("#play_btn").hide();
                $("#pause_btn").show();
            }
        });

        function msToMin(ms){
                var minutes = Math.floor(ms / 60000);
                var seconds = ((ms % 60000) / 1000).toFixed(0);
                return minutes + ":" + (seconds < 10 ? '0' : '') + seconds;
        }



        $scope.resume = function (){
            MIDI.Player.resume();
        }

        MIDI.Player.removeListener(); // removes current listener.
        MIDI.Player.addListener(function(data) { // set it to your own function!s
            $scope.$apply(function() {
                $scope.currentTime = msToMin(data.now); // where we are now
                $scope.endTime = msToMin(data.end); // time when song ends
                $scope.playing = data.playing;
            });
        });


        MIDI.loadPlugin({
            soundfontUrl: "assets/soundfont/",
            instrument: "acoustic_grand_piano",
            onprogress: function(state, progress) {
                console.log(state, progress);
            },
            onsuccess: function() {

                console.log('loading');

                    MIDI.Player.loadFile(

'data:audio/midi;base64,'                        ,

                function (ok){
                            Materialize.toast('loaded');

                        }, function (progess){
                            Materialize.toast('load in progress');

                        }, function (ko){
                            Materialize.toast('load ko');

                        }
                    );
                }
            });
    }]);

